INSERT INTO blocks VALUES(321,72,'text',replace('（Gamma-ray bursts）\n\n🌌 宇宙・科学系\n\n gamma-ray burst (GRB)：ガンマ線バースト\n\n neutron star：中性子星\n\n electromagnetic radiation：電磁放射線\n\n ultraviolet rays：紫外線\n\n ozone layer：オゾン層\n\n☄️ 影響・結果（1級頻出）\n\n devastating (to ~)：壊滅的な\n\n wipe out ~：～を一掃する／絶滅させる\n\n deplete ~：～を枯渇させる\n\n usher in ~：～の時代を招く\n\n impact (v.)：～に影響を与える\n\n🧠 抽象・論理語彙（差がつく）\n\n ripple effect：波及効果\n\n paradox：逆説\n\n relegate ~ to ...：～を…に追いやる\n\n pose a riddle/question：謎・疑問を投げかける\n\n theorize (that ~)：～と理論づける\n\n🌍 数量・確率・頻度表現\n\n countless numbers of ~：無数の～\n\n roughly / some ~：およそ～\n\n a 60% chance that ~：～の確率が60%\n\n five times more frequent：5倍頻繁に\n\n within the last 1 billion years：過去10億年以内に\n\n⭐ 構文・定型表現（即使える）\n\n be believed to ~：～と考えられている\n\n be unlikely to ~ anytime soon：近いうちに～しそうにない\n\n in astrophysics lingo：天体物理学用語では','\n',char(10)),0,5.0,0,'','{}','2026-01-25 21:30:16','2026-01-29 00:49:31');
