INSERT INTO blocks VALUES(519,101,'text',replace('🔑 今日の重要語彙まとめ\n1️⃣ enduring\n意味：長く続く、永続的な\n\n例：enduring influence（永続的な影響）\n\n✍️ 抽象論・歴史・政治系で超頻出\n\n2️⃣ gain A through B\n意味：Bを通じてAを得る\n\n例：gain influence through public support\n\n✍️ 因果関係をスマートに言える1級必須構文\n\n3️⃣ ties to the masses\n意味：大衆との結びつき\n\nmasses = 一般市民・庶民層\n\n✍️ populism / democracy 論で使える\n\n4️⃣ solidify one’s political grip\n意味：政治的支配を固める\n\ngrip = 支配・掌握\n\n✍️ 政治史・権力構造の説明で強い表現\n\n5️⃣ power base\n意味：権力の基盤・支持層\n\n例：The poor formed its power base.\n\n✍️ 抽象度が高く、論文調で使える\n\n6️⃣ represent / represented\n意味：代表する／象徴する\n\n語源：re（再び）＋present（前に出す）\n\nイメージ：\n👉「本人がいない代わりに、存在・意思・数を前に出す」\n\n✍️ 抽象語の理解として今日の重要ポイント\n\n7️⃣ set out to ~\n意味：〜しようと着手する\n\n例：set out to court voters\n\n✍️ フォーマル・論説向き\n\n8️⃣ assimilate\n意味：同化する・社会に溶け込む\n\n例：immigrants assimilate into society\n\n✍️ 移民・文化・教育テーマで頻出\n\n9️⃣ extinct\n意味：絶滅した\n\n例：extinct species\n\n✍️ 環境・生物系の定番語\n\n🔟 by definition\n意味：定義上、当然\n\n例：Extinct species are, by definition, gone forever.\n\n✍️ 論理を締める便利フレーズ\n\n1️⃣1️⃣ resurrect / resurrection\n意味：復活させる／復活\n\n文脈：絶滅種の復活・科学技術\n\n✍️ 倫理・テクノロジー論で映える語\n\n1️⃣2️⃣ clone\n意味：クローン化する\n\n✍️ 科学系の基本語（だが正確さが問われる）\n\n1️⃣3️⃣ controversy\n意味：論争\n\n例：The controversy surrounding robotic surgery\n\n✍️ 1級超頻出「論点提示ワード」\n\n1️⃣4️⃣ low-level / repetitive tasks\n意味：単純作業／反復作業\n\n✍️ AI・ロボット・労働論で使える\n\n1️⃣5️⃣ free up\n意味：（時間・人手を）解放する\n\n例：free up human surgeons\n\n✍️ 書き言葉でも口語でも使える万能句\n\n🎯 今日の総評（講師として一言）\n語彙レベルは完全に英検1級ゾーン\n\n特に\ngain through / represent / power base / set out to\nこの辺を“意味＋イメージ”で掴めているのが非常に良い\n','\n',char(10)),0,2000.0,0,'','{}','2026-01-28 03:13:43','2026-01-28 11:37:00');
