INSERT INTO blocks VALUES(685,130,'speak',replace('建築・評価・原因関係\n	•	inspired：触発された／着想を得た\n	•	constraint / constrained：制約（を受けた）\n	•	removal：撤去\n	•	greenery：緑地、植栽\n	•	inferior：劣った、質の低い\n\n⸻\n\n経済・理論・変化\n	•	underwent：経験した、経た\n	•	regulated：規制された、統制された\n	•	catastrophe：大惨事、破局\n	•	turmoil：混乱、動乱\n	•	unrestricted：制限のない、自由な\n\n⸻\n\n市場・行動・結果\n	•	desirous：強く望んでいる\n	•	trillions：数兆（ドルなど）\n	•	borne（bearの過去分詞）：負担された、背負わされた\n	•	self-correcting：自己修正する\n\n⸻\n\n新しい経済学・学際分野\n	•	hypothesis：仮説\n	•	perspective：観点、視点\n	•	advocate：提唱者／擁護する\n	•	mutation：変異、急激な変化\n	•	merge：融合する\n	•	neuroeconomics：神経経済学\n	•	neuroscience：神経科学\n	•	contend：主張する、論じる\n\n⸻\n\n抽象度の高い頻出語（英検1級）\n	•	dominance：支配、優勢\n	•	unlikely：ありそうもない\n	•	unify / unifies：統合する\n	•	model：理論モデル\n	•	hybridization：融合、ハイブリッド化\n	•	muddle (through)：混乱しながら何とか切り抜ける\n\n⸻\n\n🎯 使いこなしポイント（英検1級向け）\n	•	**cause–effect（因果）**で使える語が多い\n→ constraint, led to, resulted in, borne\n	•	**評価語（批判・分析）**に直結\n→ inferior, inefficient, irrational, unlikely\n	•	抽象論・学際論で強い\n→ hybridization, hypothesis, perspective\n','\n',char(10)),0,4000.0,0,'','{"lang":"en-US","rate":1}','2026-01-30 07:47:57','2026-01-31 02:18:30');
