INSERT INTO blocks VALUES(947,179,'speak',replace('🧠 認知・心理系（英検1級頻出）\n\ncognition\n認知（知覚・思考・理解などの知的プロセス全般）\n\nembodied (embody)\n体現された／具現化された\nembodied cognition = 身体性認知\n\npsychically / physically\npsychically：精神的に（※文脈によっては不自然）\nphysically：身体的に（今回の文脈ではこちらが自然）\n\ncomprehension\n理解（process of understanding）\n※英検1級では reading comprehension などで頻出\n\n🧍‍♂️ 身体・動作関連\n\nlean (forward / backward)\n傾く、身を乗り出す\nlean forward = 前のめりになる\n\nbackwards\n後ろ向きに、後方へ\n\nbody movement / body motion\n身体の動き（motionの方が「動作」寄り）\n\n🗣️ 言語・表現・比喩\n\nmetaphor\n比喩、隠喩\n\nspatial metaphor\n空間的比喩\n例：look forward to the future / reflect back on the past\n\nlanguage comprehension\n言語理解\n\n👥 実験・研究文脈（アカデミック表現）\n\nparticipants\n参加者（研究・実験の文脈で超頻出）\n\n(a) particular instance\n特定の事例・具体例\n※抽象論 → 具体例に落とすときに便利\n\nimaginary person\n想像上の人物\n（実験説明・思考実験で使われやすい）\n\nconjunction (with ~)\n～との結びつき／連携\nin conjunction with the brain\n= 脳と連動して\n\n🧾 例文（意味確認用）\n\nAndy must deliver a pizza to you.\nアンディはあなたにピザを届けなければならない\n→ 身体動作と意味理解の関係を示す例文\n\n🎯 英検1級視点・ワンポイント指導\n\nabstract ↔ concrete（抽象⇄具体）を行き来する語彙 が多く、1級に非常に良い素材\n\nmetaphor / cognition / comprehension / in conjunction with は\nライティング・スピーキングで即戦力','\n',char(10)),0,4000.0,0,'','{"lang":"auto","rate":1}','2026-02-01 20:36:08','2026-02-02 12:45:16');
INSERT INTO blocks VALUES(948,179,'speak',replace('📘 今日学んだ重要語彙リスト\n🧠 心理・認知／抽象テーマ\n\nsensation：感覚\n\nsubjective：主観的な\n\nprocess information：情報を処理する\n\nentire body：身体全体\n\naffect：影響を与える\n\n🌙 古代エジプト・数学関連\n\nlunar phase：月の満ち欠け\n\npractical system：実用的な体系\n\ncubit：キュビト（肘から指先までの長さの単位）\n\nutilize：活用する\n\nnumerical base：数の基数（数体系の土台）\n\n📐 数学評価・議論表現\n\nuntrained eye：素人目\n\nmathematical historian：数学史家\n\ninefficient：非効率な\n\nignore：無視する\n\nscorn：軽蔑する\n\nadmire：称賛する\n\nmemorization：暗記\n\nproblem-solving：問題解決\n\ningenuity：独創性\n\ninsight：洞察\n\n📚 理解・思考プロセス\n\ncomprehend：理解する（やや硬め・高得点語）\n\ninvest time：時間を投資する\n\nvarious ways：様々な方法で\n\n➗ 計算・数体系\n\ncomputational grind：単調な計算作業\n\nreveal：明らかにする\n\nmultiplication：掛け算\n\nlinear equation：一次方程式\n\nquadratic (equation)：二次（方程式）\n\n🔢 分数・小数関連\n\nfraction(s)：分数\n\ndecimal(s)：小数\n\ncompromise：折衷案\n\napproximation：近似（概算）\n\nterminate：終わる（小数が有限で終わる、など）\n\none-third：3分の1\n\nrigidly stick to：厳格に固執する\n\n✨ 評価・抽象表現（英検1級向き）\n\ndeserve more attention：もっと注目される価値がある\n\ninspire：刺激する／着想を与える\n\nin a fresh way：新しい視点で\n\n🎯 ワンポイント（英検1級視点）\n\nsubjective / insight / comprehend / inspire は\n👉 意見論述・長文要約で高評価\n\ncompromise / inefficient / deserve more attention は\n👉 評価・批評型テーマで即使える\n\n次は\n\n🔹「この単語を使った英検1級用模範パラグラフ」\n\n🔹「Speakingで即答できる例文練習」\n\nどっちいきますか？','\n',char(10)),0,5000.0,0,'','{"lang":"en-US","rate":1}','2026-02-01 20:36:08','2026-02-02 12:45:39');
