INSERT INTO blocks VALUES(1099,210,'speak',replace('1. conduct\n\n意味：実施する、行う\n用法：conduct research / conduct a survey\n👉 do よりフォーマルで、学術・公式文脈向き\n\n2. correlation\n\n意味：相関関係\n用法：the correlation between A and B\n👉 「因果関係（causation）」とは違う点、英検1級で頻出\n\n3. paradox\n\n意味：逆説、直感に反する事実\n用法：the Easterlin paradox\n👉 一見矛盾しているが、深く考えると真理を含む\n\n4. implication\n\n意味：含意、示唆、影響\n用法：the implication of this finding\n👉 「結果が何を意味するか」を論じるときの必須語\n\n5. determine\n\n意味：明らかにする、判断する\n用法：determine the relationship\n👉 decide より客観的・分析的\n\n6. wealth\n\n意味：富、資産\n用法：increase wealth / personal wealth\n👉 money より抽象度が高く、論文向き\n\n7. standard of living\n\n意味：生活水準\n👉 英検1級頻出の社会・経済語彙（丸暗記推奨）\n\n8. relatively\n\n意味：相対的に\n用法：relatively to others\n👉 比較・対比構文で超重要\n\n9. leveling off\n\n意味：頭打ちになる、伸びが止まる\n👉 グラフ・統計系テーマで頻出表現\n\n10. rejoice in ~\n\n意味：〜を大いに喜ぶ\n👉 文章表現としてやや皮肉・評価を含められる','\n',char(10)),0,5000.0,0,'','{"lang":"en-US","rate":1}','2026-02-07 03:19:51','2026-02-08 04:26:08');
