INSERT INTO blocks VALUES(1433,275,'speak',replace('① 知性・能力系\n\nastute（抜け目なく賢い）\n\nshrewd（鋭い・計算高い）\n\narticulate（はっきり表現できる）\n\naptitude（適性・才能）\n\nadept（熟練した）\n\ninept（不器用な）\n\ndexterous（器用な）\n\ningenious（独創的な）\n\nconcordance（一致・調和）\n\ninscribe（刻む）\n\n👉「賢く → 表現でき → 熟練する」流れで思い出すと強い。\n\n🔥② 感情・性格系\n\naffable（愛想がよい）\n\necstatic（有頂天）\n\nrueful（後悔している）\n\nobnoxious（不快な）\n\nbelligerent（喧嘩腰の）\n\nrowdy（騒がしい）\n\ncredulous（すぐ信じる）\n\ngullible（騙されやすい）\n\ndissident（反体制の人）\n\nambivalent（相反する感情）\n\nambiguous（曖昧な）\n\nauspicious（縁起が良い）\n\n👉「いい人 → 騒ぐ → 後悔 → 反抗」ってドラマで思い出せる。\n\n💰③ お金・社会・行為\n\ndividend（配当）\n\nremittance（送金）\n\nincision（切開）\n\npreclude（妨げる）\n\nreclusive（隠遁的な）\n\nexculpate（無罪にする）\n\nculprit（犯人）\n\nculpable（責任がある）\n\ninculpate（罪を着せる）\n\ndoctrine（教義）\n\nabduct / deduce / induce / seduce（導く系）\n\n👉「罪 → 教義 → 導く」でセット記憶。\n\n🌍④ 時間・構造・思考系\n\nsynchronize（同期する）\n\nchronic（慢性的な）\n\nchronological（時系列の）\n\nconcordance（一致）\n\ncongruent（一致した）\n\namphibian（両生類）\n\nambitious（野心的）\n\nanthropology（人類学）\n\nphilanthropy（慈善）\n\n👉「時間」「一致」「両方（ambi）」がキーワード。\n\n🎨⑤ 強さ・派手さ系\n\nblatant（あからさま）\n\nflagrant（悪質な）\n\ncaustic（辛辣な）\n\nvibrant（活気ある）\n\nvaliant（勇敢な）\n\nfull-fledged（一人前の）\n\nprolific（多作な）\n\nfrugal（質素な）\n\ntepid（ぬるい）\n\ncoarse（粗野な）','\n',char(10)),0,5000.0,0,'','{"lang":"en-US","rate":1}','2026-02-11 19:51:34','2026-02-13 00:39:48');
